import React from 'react';

function App() {

  React.useEffect(() => {

  }, []);

  return (
    <div className="container">
      <table className="table">
        <thead>
          <tr>
            <th>id</th>
            <th>firstName</th>
            <th>lastName</th>
            <th>email</th>
            <th>phone</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => {
            <tr>
              {/* <th scope="row">1</th> */}
              <td>{item.id}</td>
              <td>{item.firstName}</td>
              <td>{item.lastName}</td>
              <td>{item.email}</td>
              <td>{item.phone}</td>
            </tr>
          })}
        </tbody>
      </table>
    </div>
  );
}

export default App;
